    // 	.slice()
    // 	.reverse()
    // 	.find(
    // 		(m, index) =>
    // 			index !== lastClaudeMessageIndex && !(m.ask === "resume_task" || m.ask === "resume_completed_task")
    // 	)
    // (lastClaudeMessage?.ask === "command" && secondLastClaudeMessage?.ask === "completion_result")

    let askType;
    if (lastClaudeMessage?.ask === "completion_result") {
      askType = "resume_completed_task";
    } else {
      askType = "resume_task";
    }
    const {
      response,
      text,
      images
    } = await this.ask(askType); // calls poststatetowebview
    let responseText;
    let responseImages;
    if (response === "messageResponse") {
      await this.say("user_feedback", text, images);
      responseText = text;
      responseImages = images;
    }

    // need to make sure that the api conversation history can be resumed by the api, even if it goes out of sync with claude messages

    // if the last message is an assistant message, we need to check if there's tool use since every tool use has to have a tool response
    // if there's no tool use and only a text block, then we can just add a user message

    // if the last message is a user message, we can need to get the assistant message before it to see if it made tool calls, and if so, fill in the remaining tool responses with 'interrupted'

    const existingApiConversationHistory = await this.getSavedApiConversationHistory();
    let modifiedOldUserContent; // either the last message if its user message, or the user message before the last (assistant) message
    let modifiedApiConversationHistory; // need to remove the last user message to replace with new modified user message
    if (existingApiConversationHistory.length > 0) {
      const lastMessage = existingApiConversationHistory[existingApiConversationHistory.length - 1];
      if (lastMessage.role === "assistant") {
        const content = Array.isArray(lastMessage.content) ? lastMessage.content : [{
          type: "text",
          text: lastMessage.content
        }];
        const hasToolUse = content.some(block => block.type === "tool_use");
        if (hasToolUse) {
          const toolUseBlocks = content.filter(block => block.type === "tool_use");
          const toolResponses = toolUseBlocks.map(block => ({
            type: "tool_result",
            tool_use_id: block.id,
            content: "Task was interrupted before this tool call could be completed."
          }));
          modifiedApiConversationHistory = [...existingApiConversationHistory]; // no changes
          modifiedOldUserContent = [...toolResponses];
        } else {
          modifiedApiConversationHistory = [...existingApiConversationHistory];
          modifiedOldUserContent = [];
        }
      } else if (lastMessage.role === "user") {
        const previousAssistantMessage = existingApiConversationHistory[existingApiConversationHistory.length - 2];
        const existingUserContent = Array.isArray(lastMessage.content) ? lastMessage.content : [{
          type: "text",
          text: lastMessage.content
        }];
        if (previousAssistantMessage && previousAssistantMessage.role === "assistant") {
          const assistantContent = Array.isArray(previousAssistantMessage.content) ? previousAssistantMessage.content : [{
            type: "text",
            text: previousAssistantMessage.content
          }];
          const toolUseBlocks = assistantContent.filter(block => block.type === "tool_use");
          if (toolUseBlocks.length > 0) {
            const existingToolResults = existingUserContent.filter(block => block.type === "tool_result");
            const missingToolResponses = toolUseBlocks.filter(toolUse => !existingToolResults.some(result => result.tool_use_id === toolUse.id)).map(toolUse => ({
              type: "tool_result",
              tool_use_id: toolUse.id,
              content: "Task was interrupted before this tool call could be completed."
            }));
            modifiedApiConversationHistory = existingApiConversationHistory.slice(0, -1); // removes the last user message
            modifiedOldUserContent = [...existingUserContent, ...missingToolResponses];
          } else {
            modifiedApiConversationHistory = existingApiConversationHistory.slice(0, -1);
            modifiedOldUserContent = [...existingUserContent];
          }
        } else {
          modifiedApiConversationHistory = existingApiConversationHistory.slice(0, -1);
          modifiedOldUserContent = [...existingUserContent];
        }
      } else {
        throw new Error("Unexpected: Last message is not a user or assistant message");
      }
    } else {
      throw new Error("Unexpected: No existing API conversation history");
    }
    let newUserContent = [...modifiedOldUserContent];
    const agoText = (() => {
      const timestamp = lastClaudeMessage?.ts ?? Date.now();
      const now = Date.now();
      const diff = now - timestamp;
      const minutes = Math.floor(diff / 60000);
      const hours = Math.floor(minutes / 60);
      const days = Math.floor(hours / 24);
      if (days > 0) {
        return `${days} day${days > 1 ? "s" : ""} ago`;
      }
      if (hours > 0) {
        return `${hours} hour${hours > 1 ? "s" : ""} ago`;
      }
      if (minutes > 0) {
        return `${minutes} minute${minutes > 1 ? "s" : ""} ago`;
      }
      return "just now";
    })();
    newUserContent.push({
      type: "text",
      text: `Task resumption: This autonomous coding task was interrupted ${agoText}. It may or may not be complete, so please reassess the task context. Be aware that the project state may have changed since then. The current working directory is now '${cwd}'. If the task has not been completed, retry the last step before interruption and proceed with completing the task.` + (responseText ? `\n\nNew instructions for task continuation:\n<user_message>\n${responseText}\n</user_message>` : "")
    });
